import React, { useState, useEffect } from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import { Link, useHistory  } from 'react-router-dom';
import { SidebarData } from './SidebarData';
import { IconContext } from 'react-icons';
import axios from 'axios';
import { Baseurl } from '../components/Baseurl.js';


function Navbar() {
  const [sidebar, setSidebar] = useState(false);
  let lastName = ""
  const showSidebar = () => setSidebar(!sidebar);
  useEffect(() => {
    let token = localStorage.getItem('Token');
    axios.post(`${Baseurl}profile.php`, JSON.stringify(token)).then(res => {
      if (res.status == 200) {
        let profileResponse = res.data.UserInfo;
        lastName = profileResponse.lname
        // console.log(profileResponse)
      }
    })
  })
  return (
    <>
      <IconContext.Provider value={{ color: '#444444' }}>
        <div className='navbar'>
      <Link to='#' className='menu-bars' style={{textDecoration:'none'}}>
      <p className="logo">  <FaIcons.FaBars onClick={showSidebar} /> <i class="fas fa-book-reader ml-4"></i> FromHome</p>
          </Link>
        </div>
        <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
          <ul className='nav-menu-items' onClick={showSidebar}>
            <li className='navbar-toggle'>
              <Link to='#' className='menu-bars'>
                <AiIcons.AiOutlineClose/>
              </Link>
            </li>
            <p className="">ddddd</p>
            {SidebarData.map((item, index) => {
              return (
                <li key={index} className={item.cName}>
                  <Link to={item.path} style={{textDecoration:'none'}}>
                    {item.icon}
                    <span>{item.title}</span>
                  </Link>
                </li>

              );
            })}
          </ul>
        </nav>
      </IconContext.Provider>
    </>
  );
}

export default Navbar;
